import React from "react";
import "../62P.css";

const questions = [
  { id: 1, image: "/img/Question1.jpg" },
  { id: 2, image: "../img/Question2.jpg" },
  { id: 3, image: "../img/Question3.jpg" },
  { id: 4, image: "../img/Question4.jpg" },
  { id: 5, image: "../img/Question5.jpg" },
];

const P62Question = ({ onLeftSelect }) => {
  return (
    <div className="left-column">
      {questions.map((q) => (
        <div
          className="question-item"
          key={q.id}
          id={`left-${q.id}`}
          onClick={() => onLeftSelect(q.id)}
        >
          <img src={q.image} alt={`Question ${q.id}`} className="question-image" />
        </div>
      ))}
    </div>
  );
};

export default P62Question;
